### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Logarithms and Exponents**
- **Logarithmic Identities**:
  - \( \log_b b = 1 \)
  - \( \log_b 1 = 0 \)
  - \( \log_b (xy) = \log_b x + \log_b y \)
  - \( \log_b \left(\frac{x}{y}\right) = \log_b x - \log_b y \)
  - \( \log_b (x^y) = y \log_b x \)
  - Change of base formula: \( \log_b x = \frac{\log_k x}{\log_k b} \)

- **Exponential Functions**:
  - \( b^x = y \) implies \( x = \log_b y \)
  - \( b^{\log_b x} = x \)
  - \( \log_b (b^x) = x \)

#### 2. **Functions and Their Properties**
- **Injective (One-to-One) Functions**: A function \( f \) is injective if \( f(x_1) = f(x_2) \) implies \( x_1 = x_2 \).
- **Surjective (Onto) Functions**: A function \( f \) is surjective if for every \( y \) in the codomain, there exists an \( x \) in the domain such that \( f(x) = y \).
- **Differentiability and Continuity**:
  - A function \( f \) is differentiable at \( x = a \) if \( f'(a) \) exists.
  - A function \( f \) is continuous at \( x = a \) if \( \lim_{x \to a} f(x) = f(a) \).

#### 3. **Limits and Derivatives**
- **Limit Definitions**:
  - \( \lim_{x \to a} f(x) = L \) if for every \( \epsilon > 0 \), there exists a \( \delta > 0 \) such that \( |f(x) - L| < \epsilon \) whenever \( 0 < |x - a| < \delta \).
- **Derivative Definitions**:
  - \( f'(a) = \lim_{h \to 0} \frac{f(a+h) - f(a)}{h} \)
- **Special Limits**:
  - \( \lim_{x \to 0} \frac{(1 + x)^{\frac{1}{x}} - (1 - x)^{\frac{1}{x}}}{x} = 1 \)

#### 4. **Inverse Functions**
- **Inverse Function Definition**: If \( f \) is a bijective function, then its inverse \( f^{-1} \) satisfies \( f(f^{-1}(x)) = x \) and \( f^{-1}(f(x)) = x \).
- **Derivative of Inverse Function**: If \( f \) is differentiable and \( f'(f^{-1}(x)) \neq 0 \), then \( (f^{-1})'(x) = \frac{1}{f'(f^{-1}(x))} \).

#### 5. **Sequences and Series**
- **Limit of Sequences**:
  - \( \lim_{n \to \infty} a_n = L \) if for every \( \epsilon > 0 \), there exists an \( N \) such that \( |a_n - L| < \epsilon \) for all \( n > N \).

